var ws = require('nodejs-websocket');

console.log("Starting server...");
var port = 8080;
var server = ws.createServer(onConnect);
var players = [];

console.log("Listening on port " + port);
server.listen(port);

console.log("Server started");

function onConnect(con){
  console.log("New connection.");
  sendMap(con);

  con.on("text", function(data){
    data = JSON.parse(data);
    var n = server.connections.indexOf(con);
    //console.log(data.type);
    if(data.type == "update"){
      var so = players[n]
      if(so == undefined) so = {};
      for(var p in data.data){
        so[p] = data.data[p];
      }
      players[n] = so;
    }
    if(data.type == "getplayers"){
      con.send(JSON.stringify({
        type: "players",
        data: players,
        clientIndex: n
      }));
    }
  });

  con.on("close", function(code, reason){
    players.splice(server.connections.indexOf(con), 1);
  });

  con.on("error", function(e){
    console.log(e);
  });
}

var walls = [];

function sendMap(con){
  if(walls.length == 0) generateMap();
  con.send(JSON.stringify({type: "map", data: walls}));
}



